import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  Container, 
  MainContent, 
  ProfileHeading, 
  ProfileSection,
  OrderHistoryItem,
  OrderDate,
  OrderTotal,
  AddressSection,
  FormGroup,
  Label,
  Input,
  OptionButtons,
  OptionButton
} from '../styles/Components';
import Header from '../components/Header';
import Navigation from '../components/Navigation';
import { useAppContext } from '../contexts/AppContext';
import useTelegram from '../hooks/useTelegram';

type ProfileTab = 'orders' | 'address';

const ProfilePage: React.FC = () => {
  const [activeTab, setActiveTab] = useState<ProfileTab>('orders');
  const navigate = useNavigate();
  const { 
    orderHistory, 
    userAddress,
    updateUserAddress
  } = useAppContext();
  
  const { 
    showBackButton, 
    hideBackButton, 
    setBackButtonCallback, 
    hideMainButton
  } = useTelegram();

  useEffect(() => {
    showBackButton();
    hideMainButton();
    
    setBackButtonCallback(() => {
      navigate('/');
    });

    return () => {
      hideBackButton();
    };
  }, [hideBackButton, hideMainButton, navigate, setBackButtonCallback, showBackButton]);

  const handleAddressChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    updateUserAddress({
      ...userAddress || {
        street: '',
        houseNumber: '',
      },
      [name]: value
    });
  };

  const formatDate = (isoString: string) => {
    const date = new Date(isoString);
    return date.toLocaleString();
  };

  return (
    <Container>
      <Header />
      <Navigation />
      <MainContent>
        <ProfileHeading>Your Profile</ProfileHeading>
        
        <OptionButtons>
          <OptionButton 
            onClick={() => setActiveTab('orders')} 
            $active={activeTab === 'orders'}
          >
            Order History
          </OptionButton>
          <OptionButton 
            onClick={() => setActiveTab('address')} 
            $active={activeTab === 'address'}
          >
            Delivery Address
          </OptionButton>
        </OptionButtons>
        
        {activeTab === 'address' && (
          <AddressSection>
            <ProfileHeading>Delivery Address</ProfileHeading>
            <FormGroup>
              <Label htmlFor="street">Street</Label>
              <Input
                type="text"
                id="street"
                name="street"
                value={userAddress?.street || ''}
                onChange={handleAddressChange}
                placeholder="Enter street name"
              />
            </FormGroup>
            <FormGroup>
              <Label htmlFor="houseNumber">House Number</Label>
              <Input
                type="text"
                id="houseNumber"
                name="houseNumber"
                value={userAddress?.houseNumber || ''}
                onChange={handleAddressChange}
                placeholder="Enter house number"
              />
            </FormGroup>
            <FormGroup>
              <Label htmlFor="apartment">Apartment (optional)</Label>
              <Input
                type="text"
                id="apartment"
                name="apartment"
                value={userAddress?.apartment || ''}
                onChange={handleAddressChange}
                placeholder="Enter apartment number"
              />
            </FormGroup>
            <FormGroup>
              <Label htmlFor="floor">Floor (optional)</Label>
              <Input
                type="text"
                id="floor"
                name="floor"
                value={userAddress?.floor || ''}
                onChange={handleAddressChange}
                placeholder="Enter floor number"
              />
            </FormGroup>
          </AddressSection>
        )}
        
        {activeTab === 'orders' && (
          <ProfileSection>
            <ProfileHeading>Order History</ProfileHeading>
            
            {orderHistory.length === 0 ? (
              <p>You haven't placed any orders yet.</p>
            ) : (
              orderHistory.map(order => (
                <OrderHistoryItem key={order.id}>
                  <OrderDate>Order #{order.id} - {formatDate(order.date)}</OrderDate>
                  <div>
                    {order.items.map(item => (
                      <div key={item.id} style={{ marginBottom: '5px' }}>
                        {item.name} x {item.quantity} - ₽{item.price * item.quantity}
                      </div>
                    ))}
                  </div>
                  <OrderTotal>Total: ₽{order.totalAmount}</OrderTotal>
                  <div style={{ marginTop: '5px' }}>
                    Delivery Method: {order.deliveryMethod === 'delivery' ? 'Delivery' : 'Pickup'}
                  </div>
                  <div style={{ marginTop: '5px' }}>
                    Status: {order.status}
                  </div>
                </OrderHistoryItem>
              ))
            )}
          </ProfileSection>
        )}
      </MainContent>
    </Container>
  );
};

export default ProfilePage;
